        public SeedDbData(IWebHost host, ApplicationDbContext context)
        {
            var services = (IServiceScopeFactory)host.Services.GetService(typeof(IServiceScopeFactory));
            var serviceScope = services.CreateScope();
            _hostingEnv = serviceScope.ServiceProvider.GetService<IHostingEnvironment>();

            _roleManager = serviceScope.ServiceProvider.GetService<RoleManager<ApplicationRole>>();

            _userManager = serviceScope.ServiceProvider.GetService<UserManager<ApplicationUser>>();

            _context = context;

            CreateKey();

            _context.SaveChanges();

            _dataProtector = serviceScope.ServiceProvider.GetRequiredService<DataProtector>();

            _databaseManager = serviceScope.ServiceProvider.GetRequiredService<DatabaseManager>();

            CreateRoles();

            _context.SaveChanges();

            CreateAspNetUsers();

            _context.SaveChanges();

            ChangeRoles();

            _context.SaveChanges();

            CreateSizeVacations();

            _context.SaveChanges();

            //CreateCryptColumns();

            //_context.SaveChanges();

            CreateClients();

            _context.SaveChanges();

            CreateDefaultImage();

            _context.SaveChanges();
        }

        private void CreateRoles()
        {
            var rolesToAdd = new List<ApplicationRole>(){
                new ApplicationRole { Name = "Admin", Description = "Full rights role" },
                new ApplicationRole { Name = "Super_Admin", Description = "Full rights role" },
                new ApplicationRole { Name = "IT_Infracstructure", Description = "Limited rights role" },
                new ApplicationRole { Name = "Developer", Description = "Limited rights role" },
                new ApplicationRole { Name = "ProjectManager", Description = "Limited rights role" },
                new ApplicationRole { Name = "HumanResource", Description = "Limited rights role" } };

            foreach (var role in rolesToAdd)
            {
                if (!_roleManager.RoleExistsAsync(role.Name).Result)
                {
                    _roleManager.CreateAsync(role).Result.ToString();
                }
            }
        }

        private void CreateAspNetUsers()
        {
            if (!_context.ApplicationUsers.Any())
            {
                _userManager.CreateAsync(new ApplicationUser { UserName = "admin@admin.com", FirstName = "Admin", LastName = "Admin", Email = "admin@admin.com", EmailConfirmed = true, CreatedDate = DateTime.Now, IsEnabled = true }, "1").Result.ToString();
                _userManager.AddToRoleAsync(_userManager.FindByNameAsync("admin@admin.com").GetAwaiter().GetResult(), "Admin").Result.ToString();
            }

            if (!_context.UsersProfiles.Any())
            {
                _context.UsersProfiles.Add(new UserProfile()
                {
                    ApplicationUserId = _context.ApplicationUsers.Where(u => u.Email == "admin@admin.com").FirstOrDefault().Id,
                    DateBeginWork = DateTime.Now
                });
            }
        }

        private void ChangeRoles()
        {
            var users = _userManager.Users.ToList();
            foreach(var user in users)
            {
                if (_userManager.GetRolesAsync(user).Result.Contains("User"))
                {
                    var removeResult =_userManager.RemoveFromRoleAsync(user, "User").Result;
                    var addResult = _userManager.AddToRoleAsync(user, "Developer").Result;
                }
            }
        }

        private void CreateClients()
