            {
                var newClient = new Client()
                {
                    OrganizationName = "SuperCorporation",
                };
                _databaseManager.EncryptDecrypt("Clients", _dataProtector.Encrypt, newClient);
                _context.Clients.Add(newClient);
                _context.SaveChanges();
                var newContactPerson = new ContactPerson()
                {
                    FirstName = "John",
                    LastName = "Smith",
                    Email = "johndoe@gmail.com",
                    Phone = "123456789",
                    CommunicationChannel = "skype:johnsmith123",
                    ClientId = newClient.Id
                };
                _databaseManager.EncryptDecrypt("ContactPersons", _dataProtector.Encrypt, newContactPerson);
                _context.ContactPersons.Add(newContactPerson);
                _context.SaveChanges();
            }
        }

